import React from 'react';
import { NavLink } from 'react-router-dom';
import classes from './Dialogs.module.css';
import Dialog from './Dialog/Dialog';
import Message from './Message/Message';





const Dialogs = (props) => {


	let dialogsData = [
		{ id: 1, name: 'Dimych' },
		{ id: 2, name: 'Yanych' },
		{ id: 3, name: 'Arthur' }
	]


	let messagesData = [
		{ id: 1, message: 'Hay-hay' },
		{ id: 2, message: 'Hay' },
		{ id: 3, message: 'hay' }
	]




	return (
		<div className={classes.dialogs}>
			<div className={classes.dialogsItems}>
				{
					[
						<Dialog className={classes.dialog} name={dialogsData[0].name} id={dialogsData[0].id} />,
						<Dialog className={classes.dialog} name={dialogsData[1].name} id={dialogsData[1].id} />,
						<Dialog className={classes.dialog} name={dialogsData[2].name} id={dialogsData[2].id} />
					]
				}
			</div>

			<div className={classes.messages}>
				<div className={classes.message_wrapper}>
					{[
						<Message message={messagesData[0].message} />,
						<Message message={messagesData[1].message} />,
						<Message message={messagesData[2].message} />
					]}
				</div>
			</div>
		</div>
	)
}

export default Dialogs;
